import './App.css';
import {
  BrowserRouter,
  Switch,
  Route,
  Link,
  useRouteMatch,
} from "react-router-dom";
import {
  HomeScreen, 
  AboutScreen, 
  ArticleScreen, 
  ContactScreen,
  PageNotFoundScreen
} 
from './screens/ScreenExports';
function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/">
          <HomeScreen/>
        </Route>
        <Route path="/about">
          <AboutScreen/>
        </Route>
      </Switch>
  </BrowserRouter>
  );
}

export default App;
